import React from "react";
import { useEffect, useState } from "react";
import { vendiaClient } from "./VendiaClient";
import { DataGrid, GridToolbarQuickFilter } from "@mui/x-data-grid";
import RemoveCircleIcon from '@mui/icons-material/RemoveCircle';
import Button from '@mui/material/Button';
import { filterStateInitializer } from "@mui/x-data-grid/internals";

const { client } = vendiaClient();

export const DevicePage2 = () => {

    const [testList, setTestList] = useState([]);
    const [filteredTestList, setFilteredTest] = useState([]);
    const [rows, setRows] = useState([]);

    useEffect(() => {
        const loadData = async () => {
            const allTests = client.entities.test;
            setTestList(allTests);
            console.log(allTests);

            const filteredTestList = await allTests.list({
                filter: {
                  Device: {
                    contains: 'Device1',
                  }
                },
            });
            setFilteredTest(filteredTestList);
            console.log(filteredTestList);


        }

        loadData();
        
        
    }, [testList]);

    return (
        <div>
            DevicePage
        </div>
    )
}
